def customizePrescales(process):
    if not hasattr(process, 'PrescaleService'):
        print("WARNING: Missing PrescaleService!")
        return process

    # Define the prescale columns
    oriColumns = process.PrescaleService.lvl1Labels
    columns = PrescaleService.lvl1Labels
    columnIndex = cms.vint32()
    for column in columns:
        columnIndex.append(oriColumns.index(column) if column in oriColumns else -1)

    # Define the prescale table
    prescaleTable = process.PrescaleService.prescaleTable.copy()
    for pSet in prescaleTable:
        prescales = cms.vuint32()
        for newPSet in PrescaleService.prescaleTable:
            if pSet.pathName == newPSet.pathName:
                prescales = newPSet.prescales
                break
        if not prescales:
            for index in columnIndex:
                prescales.append(0 if index < 0 else pSet.prescales[index])
        pSet.prescales = prescales

    # Set the new prescale information
    process.PrescaleService.prescaleTable = prescaleTable
    process.PrescaleService.lvl1Labels = columns

    return process
